import React from 'react';


function Footer() {
  return (
    <footer className="footer">
      <div className="footer-line">
        <a href="" className="footer">Condiciones del servicio</a>
        <a href="" className="footer">¿Quiénes somos?</a>
        <span className="footer">Copyright 2022 Magic Market Corporation. Todos los derechos reservados.</span>
        <span className="footer">Términos y condiciones</span>
      </div>
    </footer>
  );
}

export default Footer;
